import { Link } from 'react-router-dom';
import './Header.scss';

const Header = () => {
  return(
    <header className="header"> 
      <nav>
        <Link className="nav-link" to="/contact">Navigation One</Link>
        <Link className="nav-link" to="/plp">Navigation Two</Link>
      </nav>
    </header>
  );
}

export default Header;
